var title_f1_28_1484="Metered dose inhaler technique";
var content_f1_28_1484=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F72362&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F72362&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Technique for use of a metered dose inhaler (MDI)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Warm MDI canister to body temperature.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shake MDI canister vigorously for 5 seconds.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Uncap mouthpiece and check for loose objects in the device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insert MDI into spacer in a vertical position. Hold the MDI upright with the index finger on the top of the medication canister and the thumb supporting the bottom of the inhaler. You may need to use the other hand to hold the spacer.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe out normally.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Close lips around spacer. For spacers that have a mask, place mask completely over nose and mouth and&nbsp;hold the mask snugly to the face. If no spacer is available, close lips around mouthpiece or position it about 4 cm from the mouth.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Keep tongue away from the spacer opening or mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Press down the top of the medication canister with the index finger to release the medication.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At the same time as the canister is pressed, inhale deeply and slowly through the mouth until the lungs are completely filled; this should take four to six seconds.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold the medication in the lungs as long as possible (4 to 10) seconds before exhaling. If using a spacer, you may inhale a second time and hold the breath if needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If a second puff is needed, wait approximately 15 to 30 seconds between puffs, or long enough to perform the next inhalation properly. Shake canister again before use.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recap mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rinse your mouth with water after using an inhaled glucocorticoid, and spit the water out rather than swallowing it.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    These instructions do NOT apply to dry powder inhalers. Cleaning instructions are provided separately.",
"    <div class=\"footnotes\">",
"     More detailed information about individual medication formulations can be found at file://www.accessdata.fda.gov/scripts/cder/drugsatfda/index.cfm.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
